import axios from 'axios';

export const FETCH_SOMETHING= 'FETCH_SOMETHING';

export function fetchJson() {

    const url = 'http://localhost:5000/api/get_rpi_info';
    const request = axios.get(url);

    return {
        type: FETCH_SOMETHING,
        payload: request
    };
}


export default function(state = {projects:[]}, action) {
  switch (action.type) {
      case FETCH_SOMETHING:
      return [ action.payload.data, ...state.projects ];
  }

  return state;
}
